        /**
         * Parses a CSV string into an array of objects.
         * @param {string} csvText The raw CSV string data.
         * @returns {Array<Object>} An array of objects, where each object represents a row.
         */
        function parseCSV(csvText) {
            // Split the text into lines, ignoring empty lines
            const lines = csvText.trim().split(/\r?\n/).filter(line => line);
            if (lines.length < 2) {
                console.error("CSV data must have a header and at least one row.");
                return []; 
            }

            // Extract headers, trim whitespace, and remove quotes
            const headers = lines[0].split(',').map(header => header.trim().replace(/"/g, ''));
            const data = [];

            for (let i = 1; i < lines.length; i++) {
                // This regex handles commas inside quoted strings
                const values = lines[i].split(/,(?=(?:(?:[^"]*"){2})*[^"]*$)/).map(value => value.trim().replace(/"/g, ''));
                if (values.length === headers.length) {
                    const rowObject = {};
                    for (let j = 0; j < headers.length; j++) {
                        rowObject[headers[j]] = values[j];
                    }
                    data.push(rowObject);
                }
            }
            return data;
        }
        
        // --- Load and parse the static data when the script runs ---
        window.onload = () => {
            employeeData = parseCSV(staticCsvData);
            // Optional: Log to console to verify data is loaded
            // console.log("Employee data loaded:", employeeData);
        };

        // --- Define a function to handle the search logic ---
        function performSearch() {
            const idToFind = document.getElementById('iosIdInput').value.trim();

            // --- Validation ---
            if (!employeeData.length) {
                displayResult('<p class="text-red-600 font-semibold">Error: Employee data is not loaded.</p>');
                return;
            }
            if (!idToFind) {
                displayResult('<p class="text-yellow-600 font-semibold">Please enter an IOS ID to search.</p>');
                return;
            }

            // --- Define the column names from the data ---
            const idColumn = "IOS ID";

            // --- Find the employee ---
            const foundEmployee = employeeData.find(employee => employee[idColumn] === idToFind);

            // --- Display the result ---
            if (foundEmployee) {
                const resultHTML = `
                    <div class="text-left w-full">
                        <p class="mb-2"><span class="font-semibold text-gray-700">Name:</span> ${foundEmployee['FULL NAME'] || 'N/A'}</p>
                        <p class="mb-4"><span class="font-semibold text-gray-700">Phone:</span> ${foundEmployee['Phone Number'] || 'N/A'}</p>
                        
                        <div class="border-t pt-4">
                            <h3 class="font-semibold text-lg mb-2 text-gray-800">Weekly Schedule</h3>
                            <ul class="space-y-1 text-gray-600">
                                <li><span class="font-medium w-12 inline-block">Sun:</span> ${foundEmployee['SUN'] || 'N/A'}</li>
                                <li><span class="font-medium w-12 inline-block">Mon:</span> ${foundEmployee['MON'] || 'N/A'}</li>
                                <li><span class="font-medium w-12 inline-block">Tue:</span> ${foundEmployee['TUE'] || 'N/A'}</li>
                                <li><span class="font-medium w-12 inline-block">Wed:</span> ${foundEmployee['WED'] || 'N/A'}</li>
                                <li><span class="font-medium w-12 inline-block">Thu:</span> ${foundEmployee['THU'] || 'N/A'}</li>
                                <li><span class="font-medium w-12 inline-block">Fri:</span> ${foundEmployee['FRI'] || 'N/A'}</li>
                                <li><span class="font-medium w-12 inline-block">Sat:</span> ${foundEmployee['SAT'] || 'N/A'}</li>
                            </ul>
                        </div>
                    </div>
                `;
                displayResult(resultHTML);
            } else {
                displayResult(`<p class="text-red-600 font-semibold">Employee with IOS ID "${idToFind}" not found.</p>`);
            }
        }

        // --- Event listener for the search button ---
        const searchButton = document.getElementById('searchButton');
        searchButton.addEventListener('click', performSearch);

        // --- Event listener for the "Enter" key in the input field ---
        const iosIdInput = document.getElementById('iosIdInput');
        iosIdInput.addEventListener('keydown', (event) => {
            // Check if the key pressed was 'Enter'
            if (event.key === 'Enter') {
                performSearch();
            }
        });

        /**
         * Displays a message or result in the result area.
         * @param {string} htmlContent The HTML string to display.
         */
        function displayResult(htmlContent) {
            const resultDiv = document.getElementById('result');
            resultDiv.innerHTML = htmlContent;
        }

    </script>
